tables.table_schema:
CREATE TABLE media_content (
    content_id INT PRIMARY KEY,
    content_title TEXT,
    content_type TEXT,
    publish_date DATE
);

CREATE TABLE user_engagement_metrics (
   user_id INT PRIMARY KEY,
   content_id INT,
   engagement_type VARCHAR(50),
   engagement_timestamp TIMESTAMP
);

CREATE TABLE audience_behavior (
   audience_id INT PRIMARY KEY,
   content_id INT,
   engagement_type VARCHAR(50),
   engagement_timestamp TIMESTAMP
);

CREATE TABLE audience_preferences (
   audience_id INT,
   genre_preference VARCHAR(50),
   content_type_preference VARCHAR(50),
   PRIMARY KEY (audience_id, genre_preference)
);
